import React, { useState } from "react";

const AddCompetitorForm = ({ addCompetitorToHeat }) => {
  const [competitorName, setCompetitorName] = useState("");
  const [category, setCategory] = useState("Shortboard");
  const [subCategory, setSubCategory] = useState("Men");
  const [boardType, setBoardType] = useState("Shortboard");
  const [gender, setGender] = useState("Men");
  const [ageCategory, setAgeCategory] = useState("Open");

  const handleAddCompetitor = (e) => {
    e.preventDefault();
    const newCompetitor = {
      name: competitorName,
      category,
      sub_category: subCategory,
      board_type: boardType,
      gender,
      age_category: ageCategory,
    };
    addCompetitorToHeat(newCompetitor);
    setCompetitorName("");
    setCategory("Shortboard");
    setSubCategory("Men");
    setBoardType("Shortboard");
    setGender("Men");
    setAgeCategory("Open");
  };

  return (
    <form onSubmit={handleAddCompetitor} className="mb-4">
      <div className="form-group">
        <label>Competitor Name:</label>
        <input
          type="text"
          className="form-control"
          value={competitorName}
          onChange={(e) => setCompetitorName(e.target.value)}
          required
        />
      </div>
      <div className="form-group mt-3">
        <label>Category:</label>
        <select
          className="form-control"
          value={category}
          onChange={(e) => setCategory(e.target.value)}
          required
        >
          <option value="Shortboard">Shortboard</option>
          <option value="Longboard">Longboard</option>
        </select>
      </div>
      <div className="form-group mt-3">
        <label>Sub Category:</label>
        <select
          className="form-control"
          value={subCategory}
          onChange={(e) => setSubCategory(e.target.value)}
          required
        >
          <option value="Men">Men</option>
          <option value="Women">Women</option>
        </select>
      </div>
      <div className="form-group mt-3">
        <label>Board Type:</label>
        <select
          className="form-control"
          value={boardType}
          onChange={(e) => setBoardType(e.target.value)}
          required
        >
          <option value="Shortboard">Shortboard</option>
          <option value="Longboard">Longboard</option>
        </select>
      </div>
      <div className="form-group mt-3">
        <label>Gender:</label>
        <select
          className="form-control"
          value={gender}
          onChange={(e) => setGender(e.target.value)}
          required
        >
          <option value="Men">Men</option>
          <option value="Women">Women</option>
        </select>
      </div>
      <div className="form-group mt-3">
        <label>Age Category:</label>
        <select
          className="form-control"
          value={ageCategory}
          onChange={(e) => setAgeCategory(e.target.value)}
          required
        >
          <option value="Open">Open</option>
          <option value="Sub12">Sub12</option>
          <option value="Sub14">Sub14</option>
          <option value="Sub18">Sub18</option>
          <option value="Professional">Professional</option>
          <option value="+40">+40</option>
          <option value="+45">+45</option>
          <option value="+50">+50</option>
          <option value="+60">+60</option>
          <option value="+65">+65</option>
          <option value="+70">+70</option>
        </select>
      </div>
      <button type="submit" className="btn btn-primary mt-3">
        Add Competitor
      </button>
    </form>
  );
};

export default AddCompetitorForm;
